import React from 'react'
import MagicCards from '../MagicCards/MagicCards'

const UserDeck = (props)=>{
	const newDeckArr = props.state.usersDeck.map((usersCards, i)=>{
		return <li key={i}> {usersCards.name} </li>
	})
	return(
		<ul>
			{newDeckArr}
		</ul>
	)
}

export default UserDeck
